import styled from "styled-components";
import React from "react";

const Line = styled.div`
    height: 3px;
    width: 25px;
    background-color: white;
    margin: 3px;
`;
const Burg = styled.div`
    position: absolute;
    top: 15%;
    right: 5%;
`;
const Burger = () => {
    return (
        <Burg>
            <Line />
            <Line />
            <Line />
        </Burg>
    );
};

export default Burger;
